<pre><code>{
_id: &quot;userID&quot;,
array_1:[],
array_2:[]
}
</code></pre>
<p>I need to do two updates to this document:</p>
<ol>
<li><code>array_1</code> contains objects with unique <code>id</code> property. I need to find one where <code>id=targetID</code> and replace it with the <code>newObject</code>, like this:</li>
</ol>
<pre><code>User.updateOne(
    {
      _id: userID, 
      &quot;array_1.id&quot;: targetID
    }, 
     {
       &quot;$set&quot;:{&quot;array_1.$&quot;:newObject}
     }
  )
</code></pre>
<ol start="2">
<li><code>array_2</code> contains objects, where multiple objects can have same <code>id</code> values. I need to update 2 properties of all objects in the <code>array_2</code> where <code>id=targetID</code>, like this:</li>
</ol>
<pre><code>User.updateOne(
