Add a total to aggregated sub-totals in MongoDB<p>Let's say I have documents in my MongoDB collection that look like this:</p>
<pre><code>{ name: &quot;X&quot;, ...}
{ name: &quot;Y&quot;, ...}
{ name: &quot;X&quot;, ...}
{ name: &quot;X&quot;, ...}
</code></pre>
<p>I can create a pipeline view using aggregation that shows sub-totals i.e.</p>
<pre><code>$group: {
  _id: '$name',
  count: {
    $sum: 1
  }
}
</code></pre>
<p>which results in:</p>
<pre><code>{ _id: &quot;X&quot;,
  count: 3 },
{ _id: &quot;Y&quot;,
  count: 1}
</code></pre>
<p>but how do I add a total in this view i.e.</p>
<pre><code>{ _id: &quot;X&quot;,
  count: 3 },
{ _id: &quot;Y&quot;,
  count: 1},
{_id: &quot;ALL&quot;,
 count: 4}
</code></pre>

