How to search for multiple ObjectIds using MongoDB Atlas Search<p>I have documents in a MongoDB collection that reference ObjectIds in a different collection. For example, my Orders collection has documents with a CustomerId.</p>
<p>Using MongoDB Atlas search, I've defined an index that allows me to search the CustomerId field with this syntax:</p>
<pre><code>{
  &quot;index&quot;: &quot;Orders&quot;,
  &quot;equals&quot;: {
    &quot;path&quot;: &quot;CustomerId&quot;
    &quot;value&quot;: new ObjectId(&quot;5m5....&quot;)
  }
}
</code></pre>
<p>(The above snippet is from the $search stage of my aggregation pipeline.)</p>
<p>But now I need to perform an OR search using multiple customer Ids. Unfortunately, I can't just specify an array of ObjectIds when using the <code>equals</code> operator. <a href="https://docs.atlas.mongodb.com/atlas-search/equals/" rel="nofollow noreferrer">https://docs.atlas.mongodb.com/atlas-search/equals/</a></p>
<p>What are my options for searching a MongoDB Atlas Search index with multiple ObjectIds?</p>

