Mongoose / mondoDB Use of expired sessions is not permitted<p>I'm trying to make a transaction with mongoose.</p>
<p>When I'm running the code, it looks like mongoose document remembers the session even after calling <code>await session.endSession()</code>. And later, when I call .save() on that document, I get error &quot;Use of expired sessions is not permitted&quot;.</p>
<p>This is the demo (just a simplified example):</p>
<pre><code>const MessageSchema = new mongoose.Schema({ text: String }, {strict: 'throw'});
const Message = mongoose.model('Message', MessageSchema);

const session = await mongoose.startSession();

let message;

await session.withTransaction(async () =&gt; {
    message = (await Message.create([{text: 'My message'}], {session}))[0];
});

await session.endSession();

message.text = 'My message 2';
await message.save();
</code></pre>
<p>That final <code>.save()</code> is throwing that error. If you would log <code>message.$session().hasEnded</code> you would get true. My expectation was that, if session has ended, .save() would be smart not to use it.</p>
<p>What I want to achieve:
Create some documents with transaction, commit them, so they are in the database.</p>
<p>Later, use that same document, that is already in the database, to make some changes to it.</p>
<p>What am I doing wrong here? How can I prevent <code>.save()</code> from throwing an error and trying to use expired session?</p>

