MongoDB 4.4, Java driver 4.2.3 - InsertManyResult.getInsertedIds() not returning IDs for all inserted documents<p>I am trying to retrieve values of <code>_id</code> for inserted documents after successful <code>InsertMany</code> operation. To achieve this I am using <code>InsertManyResult.getInsertedIds()</code>. While this approach works most of the time there are cases where not all <code>_id</code> values are retrieved.<br/>
<br/>
I am not sure if I am doing something wrong but I would assume that <code>InsertManyResult.getInsertedIds()</code> returns <code>_id</code> for <em>all</em> the documents inserted.<br/></p>
<h3>Problem details</h3>
<p>I am inserting 1000 documents in MongoDB in two batches of 500 documents. Each document is approx 1 MB in size.<br/>
<br/>
After batch is inserted using <code>InsertMany</code> I attempt to read values of <code>_id</code> via <code>InsertManyResult.getInsertedIds()</code> and save it to a collection for later use.<br/>
<br/>
I would assume that after inserting <em>500</em> documents via <code>InsertMany</code> the <code>InsertManyResult.getInsertedIds()</code> would return <em>500</em> <code>_id</code> values. It is however returning only <em>16</em> <code>_id</code> values out of <em>500</em>.<br/>
<br/>
When I check the Mongo collection directly via Mongo Shell I see that all records were successfully inserted. There is <em>1000</em> documents in my test collection. I am just unable to get the <code>_id</code> of all the inserted document via <code>InsertManyResult.getInsertedIds()</code>. I only get <em>32</em> <code>_id</code> for 1000 documents inserted.</p>
<h3>JSON structure</h3>
<p>To replicate the issue I have exactly <strong>one</strong> JSON which is approx 1 MB in size which looks like this.</p>
<pre><code>{
  &quot;textVal&quot; : &quot;RmKHtEMMzJDXgEApmWeoZGRdZJZerIj1&quot;,
  &quot;intVal&quot; : 161390623,
  &quot;longVal&quot; : &quot;98213019054010317&quot;,
  &quot;timestampVal&quot; : &quot;2020-12-31 23:59:59.999&quot;,
  &quot;numericVal&quot; : -401277306,
  &quot;largeArrayVal&quot; : [ &quot;MMzJDXg&quot;, &quot;ApmWeoZGRdZJZerI&quot;, &quot;1LhTxQ&quot;, &quot;adprPSb1ZT&quot;, ..., &quot;QNLkBZuXenmYE77&quot;]

}
</code></pre>
<p>Note that key <code>largeArrayVal</code> is holding almost all the data. I have omitted most of the values for readability.</p>
<h3>Sample code</h3>
<p>The code below parses JSON shown above into a <code>Document</code> which is then inserted to MongoDB via <code>InsertMany</code>. After that is done I try to get inserted <code>_id</code> using <code>InsertManyResult.getInsertedIds()</code>.</p>
<pre><code>private static final int MAX_DOCUMENTS = 1000;
private static final int BULK_SIZE = 500;

private static List&lt;ObjectId&gt; insertBatchReturnIds(List&lt;Document&gt; insertBatch)
{
  List&lt;ObjectId&gt; insertedIds = new ArrayList&lt;ObjectId&gt;();
  InsertManyResult insertManyResult;

  insertManyResult = mongoClient.getDatabase(MONGO_DATABASE).getCollection(MONGO_COLLECTION).insertMany(insertBatch);
  insertManyResult.getInsertedIds().forEach((k,v) -&gt; insertedIds.add(v.asObjectId().getValue()));

  System.out.println(&quot;Batch inseted:&quot;);
  System.out.println(&quot; - Was acknowladged: &quot; + Boolean.toString(insertManyResult.wasAcknowledged()).toUpperCase());
  System.out.println(&quot; - InsertManyResult.getInsertedIds().size(): &quot; + insertManyResult.getInsertedIds().size());

  return insertedIds;
}

private static void insertDocuments()
{
  int documentsInserted = 0;
  List&lt;Document&gt; insertBatch = new ArrayList&lt;Document&gt;();
  List&lt;ObjectId&gt; insertedIds = new ArrayList&lt;ObjectId&gt;();
  final String largeJson = loadLargeJsonFromFile(&quot;d:\\test-sample.json&quot;);

  System.out.println(&quot;Starting INSERT test...&quot;);
  while (documentsInserted &lt; MAX_DOCUMENTS)
  {
    insertBatch.add(Document.parse(largeJson));
    documentsInserted++;

    if (documentsInserted % BULK_SIZE == 0)
    {
     insertedIds.addAll(insertBatchReturnIds(insertBatch));
     insertBatch.clear();
    }
  }
  if (insertBatch.size() &gt; 0)
    insertedIds.addAll(insertBatchReturnIds(insertBatch));
  System.out.println(&quot;INSERT test finished&quot;);

  System.out.println(String.format(&quot;Expected IDs retrieved: %d. Actual IDs retrieved: %d.&quot;, MAX_DOCUMENTS, insertedIds.size()));
  if (insertedIds.size() != MAX_DOCUMENTS)
    throw new IllegalStateException(&quot;Not all _ID were returned for each document in batch&quot;);
}

</code></pre>
<h2>Sample output</h2>
<pre><code>Starting INSERT test...
Batch inseted:
 - Was acknowladged: TRUE
 - InsertManyResult.getInsertedIds().size(): 16
Batch inseted:
 - Was acknowladged: TRUE
 - InsertManyResult.getInsertedIds().size(): 16
INSERT test finished
Expected IDs retrieved: 1000. Actual IDs retrieved: 32.
Exception in thread &quot;main&quot; java.lang.IllegalStateException: Not all _ID were returned for each document in batch
</code></pre>
<h3>My questions</h3>
<ol>
<li>Is <code>InsertManyResult.getInsertedIds()</code> meant to return <code>_id</code> for <em>all</em> documents inserted?</li>
<li>Is the way I am using <code>InsertManyResult.getInsertedIds()</code> correct?</li>
<li>Could size of the inserted JSON be a factor here?</li>
<li>How should I use <code>InsertManyResult</code> to get <code>_id</code> for inserted documents?</li>
</ol>
<h2>Note</h2>
<p>I am aware that I can either read <code>_id</code> after <code>Document.parse</code> as it is the driver that generates this or I can select <code>_id</code> after documents were inserted.<br/>
I would like to know how can this be achieved using <code>InsertManyResult.getInsertedIds()</code> as it seems to be made to fit this purpose.</p>

