Ensure a Callback is Complete in Mongo Node Driver<p>I am a bit new to JavaScript web dev, and so am still getting my head around the flow of asynchronous functions, which can be a bit unexpected to the uninitiated. In my particular use case, I want execute a routine on the list of available databases before moving into the main code. Specifically, in order to ensure that a test environment is always properly initialized, I am dropping a database if it already exists, and then building it from configuration files.</p>
<p>The basic flow I have looks like this:</p>
<pre><code>let dbAdmin = client.db(&quot;admin&quot;).admin();
dbAdmin.listDatabases(function(err, dbs){/*Loop through DBs and drop relevant one if present.*/});
return await buildRelevantDB();
</code></pre>
<p>By peppering some <code>console.log()</code> items throughout, I have determined that the <code>listDatabases()</code> call basically puts the callback into a queue of sorts. I actually enter <code>buildRelevantDB()</code> <em>before</em> entering the callback passed to listDatabases. In this particular example, it seems to work anyway, I think because the call that reads the configuration file is also asynchronous and so puts items into the same queue but later, but I find this to be brittle and sloppy. There must be some way to ensure that the <code>listDatabases</code> portion resolves before moving forward.</p>
<p>The closest solution I found is <a href="https://stackoverflow.com/questions/49911357/ensure-a-set-of-deferred-then-callbacks-completes">here</a>, but I still don't know how to get the callback I pass to listDatabases to be like a <code>then</code> as in that solution.</p>

